import './App.css';
import { BrowserRouter,Route , Routes } from 'react-router-dom';
import Home from "./Pages/Home/Home"
import excersice from "./Pages/excersiceDetails/excersice"
function App() {
  return (
    <BrowserRouter>

     <Routes>
       <Route path='/' element={<Home.js/>}/>
       <Route path='/excersice/:id' element={<excersice.js/>}/>
     </Routes>

    </BrowserRouter>
  );
}

export default App;
